import React, { useState, useRef, useEffect } from 'react';
import { 
  Container, Paper, Typography, TextField, Button, Box, 
  CircularProgress, Avatar, Divider, IconButton, ThemeProvider, 
  createTheme, CssBaseline
} from '@mui/material';
import SendIcon from '@mui/icons-material/Send';
import PsychologyIcon from '@mui/icons-material/Psychology';
import PersonIcon from '@mui/icons-material/Person';
import ReactMarkdown from 'react-markdown';
import axios from 'axios';

// Create a theme with modern Gen Z friendly colors
const theme = createTheme({
  palette: {
    primary: {
      main: '#7F5AF0', // Modern purple
      light: '#9D7FFF',
      dark: '#6A3DE8',
    },
    secondary: {
      main: '#FF6B6B', // Vibrant coral
      light: '#FF9E9E',
      dark: '#FF4545',
    },
    background: {
      default: '#16161A',
      paper: '#242629',
    },
    text: {
      primary: '#FFFFFE',
      secondary: '#94A1B2',
    },
    error: {
      main: '#FF5470',
    },
    success: {
      main: '#2CB67D',
    },
  },
  typography: {
    fontFamily: '"Poppins", "Roboto", "Helvetica", "Arial", sans-serif',
    h4: {
      fontWeight: 700,
      letterSpacing: '-0.5px',
    },
    subtitle1: {
      fontWeight: 500,
      letterSpacing: '0.2px',
    },
    button: {
      fontWeight: 600,
      letterSpacing: '0.5px',
    },
  },
  shape: {
    borderRadius: 16,
  },
  components: {
    MuiButton: {
      styleOverrides: {
        root: {
          textTransform: 'none',
          fontWeight: 600,
          boxShadow: 'none',
          '&:hover': {
            boxShadow: '0 4px 12px rgba(127, 90, 240, 0.3)',
            transform: 'translateY(-2px)',
            transition: 'all 0.2s ease-in-out',
          },
        },
      },
    },
    MuiPaper: {
      styleOverrides: {
        root: {
          backgroundImage: 'linear-gradient(135deg, rgba(36, 38, 41, 0.8) 0%, rgba(22, 22, 26, 0.9) 100%)',
          boxShadow: '0 8px 32px rgba(0, 0, 0, 0.2)',
          backdropFilter: 'blur(10px)',
        },
      },
    },
    MuiTextField: {
      styleOverrides: {
        root: {
          '& .MuiOutlinedInput-root': {
            '& fieldset': {
              borderColor: 'rgba(148, 161, 178, 0.2)',
            },
            '&:hover fieldset': {
              borderColor: 'rgba(148, 161, 178, 0.5)',
            },
            '&.Mui-focused fieldset': {
              borderColor: '#7F5AF0',
            },
          },
          '& .MuiInputBase-input': {
            color: '#FFFFFE',
          },
          '& .MuiInputLabel-root': {
            color: '#94A1B2',
          },
        },
      },
    },
    MuiCssBaseline: {
      styleOverrides: {
        body: {
          backgroundImage: 'linear-gradient(135deg, #16161A 0%, #242629 100%)',
          backgroundAttachment: 'fixed',
          scrollbarWidth: 'thin',
          '&::-webkit-scrollbar': {
            width: '8px',
          },
          '&::-webkit-scrollbar-track': {
            background: '#242629',
          },
          '&::-webkit-scrollbar-thumb': {
            background: '#7F5AF0',
            borderRadius: '4px',
          },
        },
      },
    },
  },
});

// Animation keyframes for messages
const messageAnimation = {
  '@keyframes fadeIn': {
    '0%': {
      opacity: 0,
      transform: 'translateY(10px)',
    },
    '100%': {
      opacity: 1,
      transform: 'translateY(0)',
    },
  },
  '@keyframes pulse': {
    '0%': {
      transform: 'scale(1)',
    },
    '50%': {
      transform: 'scale(1.05)',
    },
    '100%': {
      transform: 'scale(1)',
    },
  },
};

function App() {
  const [input, setInput] = useState('');
  const [messages, setMessages] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const messagesEndRef = useRef(null);

  // Sample welcome message
  useEffect(() => {
    setMessages([
      {
        text: "Hi there! I'm TheraPeek, your mental health chat companion. How are you feeling today?",
        sender: 'bot',
        timestamp: new Date(),
      },
    ]);
  }, []);

  // Auto-scroll to bottom of messages
  useEffect(() => {
    scrollToBottom();
  }, [messages]);

  const scrollToBottom = () => {
    messagesEndRef.current?.scrollIntoView({ behavior: 'smooth' });
  };

  const handleInputChange = (e) => {
    setInput(e.target.value);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!input.trim()) return;

    // Add user message to chat
    const userMessage = {
      text: input,
      sender: 'user',
      timestamp: new Date(),
    };
    setMessages((prev) => [...prev, userMessage]);
    setInput('');
    setLoading(true);
    setError(null);

    try {
      // Call API
      const response = await axios.post('/api/chat', {
        message: input,
        max_length: 100,
        temperature: 0.7,
      });

      // Add bot response to chat
      const botMessage = {
        text: response.data.response || "I'm not sure how to respond to that.",
        sender: 'bot',
        timestamp: new Date(),
        processingTime: response.data.processing_time,
      };
      setMessages((prev) => [...prev, botMessage]);
    } catch (err) {
      console.error('Error communicating with the API:', err);
      setError('Sorry, I had trouble connecting. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  const formatTime = (date) => {
    return date.toLocaleTimeString([], { hour: '2-digit', minute: '2-digit' });
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Container maxWidth="md" sx={{ height: '100vh', py: 4 }}>
        <Paper 
          elevation={3} 
          sx={{ 
            height: '100%', 
            display: 'flex', 
            flexDirection: 'column',
            overflow: 'hidden',
            borderRadius: 3,
          }}
        >
          {/* Header */}
          <Box sx={{ p: 2, bgcolor: 'primary.main', color: 'white' }}>
            <Typography variant="h4" component="h1" sx={{ display: 'flex', alignItems: 'center' }}>
              <PsychologyIcon sx={{ mr: 1, fontSize: 32 }} />
              TheraPeek
            </Typography>
            <Typography variant="subtitle1">
              Your Gen Z Mental Health Companion
            </Typography>
          </Box>

          {/* Messages Area */}
          <Box 
            sx={{ 
              flexGrow: 1, 
              p: 2, 
              overflowY: 'auto',
              display: 'flex',
              flexDirection: 'column',
              gap: 2,
            }}
          >
            {messages.map((msg, index) => (
              <Box 
                key={index}
                sx={{
                  display: 'flex',
                  flexDirection: msg.sender === 'user' ? 'row-reverse' : 'row',
                  alignItems: 'flex-start',
                  gap: 1,
                  animation: `${messageAnimation['@keyframes fadeIn']} 0.3s ease-out`,
                  mb: 2,
                }}
              >
                <Avatar 
                  sx={{ 
                    bgcolor: msg.sender === 'user' ? 'secondary.main' : 'primary.main',
                    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.15)',
                    transform: 'scale(1.1)',
                    transition: 'all 0.2s ease-in-out',
                    '&:hover': {
                      transform: 'scale(1.15)',
                    }
                  }}
                >
                  {msg.sender === 'user' ? <PersonIcon /> : <PsychologyIcon />}
                </Avatar>
                <Paper 
                  elevation={3}
                  sx={{
                    p: 2,
                    maxWidth: '70%',
                    bgcolor: msg.sender === 'user' ? 'secondary.main' : 'primary.light',
                    color: msg.sender === 'user' ? 'white' : 'text.primary',
                    borderRadius: msg.sender === 'user' ? '18px 18px 4px 18px' : '18px 18px 18px 4px',
                    position: 'relative',
                    boxShadow: '0 4px 20px rgba(0, 0, 0, 0.1)',
                    backdropFilter: 'blur(10px)',
                    transition: 'all 0.2s ease-in-out',
                    '&:hover': {
                      boxShadow: '0 6px 24px rgba(0, 0, 0, 0.15)',
                      transform: 'translateY(-2px)'
                    }
                  }}
                >
                  <ReactMarkdown>{msg.text}</ReactMarkdown>
                  <Typography variant="caption" display="block" sx={{ mt: 1, textAlign: 'right', opacity: 0.8, color: msg.sender === 'user' ? 'rgba(255,255,255,0.9)' : 'text.secondary' }}>
                    {formatTime(msg.timestamp)}
                    {msg.processingTime && ` · ${msg.processingTime}s`}
                  </Typography>
                </Paper>
              </Box>
            ))}
            {loading && (
              <Box sx={{ display: 'flex', alignItems: 'center', gap: 2, ml: 2 }}>
                <Avatar sx={{ bgcolor: 'primary.main' }}>
                  <PsychologyIcon />
                </Avatar>
                <CircularProgress size={24} />
              </Box>
            )}
            {error && (
              <Box sx={{ p: 2, color: 'error.main', textAlign: 'center' }}>
                <Typography>{error}</Typography>
              </Box>
            )}
            <div ref={messagesEndRef} />
          </Box>

          <Divider />

          {/* Input Area */}
          <Box 
            component="form" 
            onSubmit={handleSubmit}
            sx={{ 
              p: 2, 
              display: 'flex', 
              alignItems: 'center',
              gap: 1,
              bgcolor: 'background.paper',
            }}
          >
            <TextField
              fullWidth
              variant="outlined"
              placeholder="Type your message here..."
              value={input}
              onChange={handleInputChange}
              disabled={loading}
              sx={{ 
                '& .MuiOutlinedInput-root': {
                  borderRadius: 3,
                }
              }}
            />
            <Button
              type="submit"
              variant="contained"
              color="primary"
              disabled={loading || !input.trim()}
              endIcon={<SendIcon />}
              sx={{ 
                height: 56,
                borderRadius: 3,
                px: 3,
              }}
            >
              Send
            </Button>
          </Box>
        </Paper>
      </Container>
    </ThemeProvider>
  );
}

export default App;
